import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Home from './pages/home'

function App() {
  return (
    <BrowserRouter>
    <div className='container'>
      <div className="alert alert-primary" style={{borderRadius: 10}}>
        <button className="btn btn-primary">Home</button> &nbsp;
        <button className="btn btn-primary">Profile</button> &nbsp;
      </div>
    </div>
      <Routes>
        <Route exact path={"/"} element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
